INSERT INTO public."Entertainments"("Id", "Price", "TypeEntertainment", "Details", "Area", "Latitude", "Longitude", "CreationDate", "City", "UrlImage", "Name", "UrlSite")
VALUES ('gen_random_uuid()', "2500", 3, 'Большие номера. Наши номера 80 м2. Автоматическое управление. Гарантирует комфортный отдых и не оставляет шансов на ошибку. Сауна и хамам и бассейн в каждом номере. Вместимость сауны - 8 чел., Хамам - 10 чел. Работаем круглосуточно. Мы готовы принять вас в любое время дня и ночи без выходных. Кухня и бар. Наши повара приготовят для вас блюда из мяса и морепродуктов, а бармен сделает авторские алкогольные и безалкогольные коктейли. Собственная парковка. Ваша машина всегда под видеонаблюдением. А также вы всегда найдете такси. Собственные гостиничные номера. Три гостиничных номера и номер для молодоженов. Можно с детьми. Отдых всей семьей с удовольствием', 1, 56.49340706823878, 84.98004200000003, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/barvixa/', 'Barvиха', 'http://sauna-barvixa.ru/'),
('gen_random_uuid()', "1000", 3, 'Сауна «Сайгон» предлагает своим гостям все для прекрасного отдыха в большой компании! ', 1, 56.49982156822522, 84.9861235, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/saigon/', 'Сайгон', 'saigon.tomsk.ru'),
('gen_random_uuid()', "600", 3, 'Сауна «Союз» расположена в самом центре города. Приглашает вас провести время с пользой для здоровья в летние дни и ночи, искупаться в нашем огромном бассейне и погреться в просторных саунах. Мы предлагаем на выбор 2 больших зала, где можно разгуляться любой компанией, у нас имеются зоны отдыха с мягкими диванами и большими столами. Также есть комнаты с двухспальной кроватью.', 0, 56.466504568259765, 84.98349149999993, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/soyuz/', 'Союз', 'https://sauna-souzvtomske.ru/'),
('gen_random_uuid()', "1700", 3, 'Оздоровительный остров «Ибица» для всей семьи приглашает вас окунуться в мир блаженства! Наша сауна прекрасно подходит для празднования дней рождения и других мероприятий в большой компании! Также вы можете приобрести подарочные сертификаты онлайн на сайте или в сауне у администратора.', 1, 56.49447506824153, 84.95668549999999, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/ibiza/', 'Ибица', 'http://sauna-ibiza.ru/'),
('gen_random_uuid()', "1000", 3, 'Сауна: • большой бассейн; • караоке; • бильярд; • большая гостиная; • комната отдыха; • финская парная, час до 1000 рублей; • доставка еды из кафе. Гостиница: номер стандарт — 1500 рублей, номер полулюкс — 2500 рублей, люкс — 3500 рублей. Возможно снять номер на половину суток, а также почасовая оплата.', 1, 56.51176356819576, 85.038127, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/retro/', 'Ретро', ''),
('gen_random_uuid()', "800", 3, 'Для вас работают 2 сауны: • малый номер — 600 р./ч; • большой номер — 1000 р./ч. Скидки в будние дни.', 0, 56.47984856823396, 85.01217449999999, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/sovet/', 'Совет', 'https://70000001064045899.2gis.biz/'),
('gen_random_uuid()', "1300", 3, '6-й ч в подарок! У вас праздник, просто хочется отдохнуть или побаловать себя масками, скрабами и прочими радостями для кожи? Тогда вам к нам! Сауна «Незабудка» — четыре прекрасных номера на любой вкус.', 1, 56.501480568229454, 85.06937949999995, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/nezabudka/', 'Незабудка', 'sauna-nezabudka.ru'),
('gen_random_uuid()', "350", 3, 'Старые традиции в новом обрамлении! Общественные бани в новом формате. Общие отделения, номера и сауны хорошей комплектации. Здоровый, семейный и коллективный отдых, возможность проведения корпоративов до 60 чел.', 1, 56.49605056821551, 85.0715534999999, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/banisTomsk/', 'Томские бани', 'https://banis.tomsk.ru/'),
