('gen_random_uuid()', "1200", 3, '«Парад Парк Отель» — комплекс комфортных решений для работы и отдыха. • банкетный зал и летняя веранда с фотозоной; • свадебный шатёр с лужайкой и подиумом; • свадебная церемония у озера; • фотосессии. Комфортная инфраструктура парка, живописные виды. Уютные номера всегда! • Русская банька на дровах и сауна.', 3, 56.44627956826788, 84.9281555, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/paradPark/', 'Парад Парк Отель', 'https://paradpark.ru/'),
('gen_random_uuid()', "2000", 3, 'Комплекс отдыха «Montana» станет лучшим выбором для тех, кто ищет комфортабельное место в Томске. Мы предлагаем своим гостям 9 уютных гостинечных номеров и 2 зала отдыха сауны с бассейном, сауной, хамамом, бильярдом и комнатами отдыха. Каждый номер и каждый зал отдыха оформлен в собственном стиле и оснащен необходимой техникой. Имеется свадебный номер, романтичная обстановка которого сделает время, проведенное в нем, незабываемым. Индивидуальный подход, система скидок, стоимость наших номеров и залов отдыха приятно удивят вас.', 1, 56.50268356823254, 84.962489, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/montana/', 'Монтана', 'montana.tomsk.ru'),
('gen_random_uuid()', "1300", 3, 'У нас Вы сможете приятно провести свое время и хорошо отдохнуть в компании друзей и близких. К Вашим услугам два превосходных номера. Номер "ЛЮКС" площадью 230 кв.м прекрасно подходит для проведения корпоративных мероприятий, юбилеев и веселых вечеринок до 20 человек. В уютном номере "СТАНДАРТ" вместимостью до 8 человек Вас ждет приятная обстановка которая позволит отдохнуть и расслабиться после рабочих будней. Отдых в нашей сауне не оставит равнодушным даже искушённого посетителя!', 0, 56.47122306824185, 84.98523449999988, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Barakuda/', 'Барракуда', 'https://barracuda.tom.ru/'),
('gen_random_uuid()', "600", 3, 'Комплекс бань включает в себя 4 номера, каждый из которых состоит из гостевой зоны с большим столом, парной, раздевалкой, душевой и уборной комнатами. Весь комплекс содержится в отличном состоянии как внешне, так и санитарно. Мы предлагаем полный спектр банных услуг для небольшой компании.', 3, 56.471993568273874, 84.94010299999988, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Oazhis/', 'Оазис', 'http://banya.oasis-tomsk.ru/'),
('gen_random_uuid()', "1000", 3, 'Турецкий хамам. Финская сауна. Бассейн с гидромассажем. Комната отдыха с кабельным TV. SPA программы', 0, 56.47418106824942, 84.97921550000002, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/Energethic/', 'Энергетик', 'http://energy.tomsk.ru'),
('gen_random_uuid()', "1400", 3, 'Сауны банного комплекса «Ширли-мырли» приглашают вас провести приятно время у нас в гостях! Состоит комплекс из саун, расположенных на пр. Ленина 30/2 и новой сауны на ул. Гоголя 36а. Мы постарались создать для вас приятную атмосферу уюта и комфортабельного отдыха.', 0, 56.47510106825183, 84.96199499999993, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/shirliMirli/', 'Ширли-мырли', 'http://shirli-m.ru'),
('gen_random_uuid()', "1400", 3, 'Сауны банного комплекса «Ширли-мырли» приглашают вас провести приятно время у нас в гостях! Состоит комплекс из саун, расположенных на пр. Ленина 30/2 и новой сауны на ул. Гоголя 36а. Мы постарались создать для вас приятную атмосферу уюта и комфортабельного отдыха.', 3, 56.46453956825472, 84.94840349999997, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/shirliMirli/', 'Ширли-мырли', 'http://shirli-m.ru'),


